text:
Here is a video of how it looks: https:&#x2F;&#x2F;www.youtube.com&#x2F;watch?v=PPSMgJa8YHQ (this video is from my extension which uses the same code, but I forgot I can make it into a bookmarklet: https:&#x2F;&#x2F;github.com&#x2F;jackdoe&#x2F;ffs-ungpt)<p>You can see the expanded code at https:&#x2F;&#x2F;gist.github.com&#x2F;jackdoe&#x2F;ce5a60b97e6d8487553cb00aa43fe0c6#file-chatgpt-summarize-bookmarklet<p>Bookmarklet code:<p><pre><code>    javascript:(function(api_key) { var selection = window.getSelection().toString(); if (selection.length == 0) return; var xhr = new XMLHttpRequest(); xhr.open(&quot;POST&quot;, &quot;https:&#x2F;&#x2F;api.openai.com&#x2F;v1&#x2F;chat&#x2F;completions&quot;); xhr.setRequestHeader(&#x27;Content-Type&#x27;, &#x27;application&#x2F;json&#x27;); xhr.setRequestHeader(&#x27;Authorization&#x27;, &#x27;Bearer &#x27; + api_key); window.scrollTo({top: 0}); window.document.body.innerHTML = &#x27;asking...&#x27;; window.document.body.style.backgroundColor = &quot;white&quot;; window.document.body.style.color = &quot;black&quot;; window.document.body.style.fontFamily = &#x27;monospace&#x27;; window.document.body.style.fontSize = &quot;16px&quot;; window.document.body.style.margin = &quot;auto&quot;; window.document.body.style.padding = &quot;1rem&quot;; window.document.body.style.maxWidth = &quot;60rem&quot;; xhr.onreadystatechange = function() { if (xhr.readyState == 4) { if (xhr.status == 200) { var response = JSON.parse(xhr.responseText); var summary = response.choices[0].message.content; window.document.body.innerHTML = summary } else { try { var e = JSON.parse(xhr.responseText); window.document.body.innerHTML = e.error.message } catch(e) { window.document.body.innerHTML = &#x27;error asking.. check the console&#x27;; console.log(xhr) } } } }; var data = JSON.stringify({ &quot;model&quot;: &quot;gpt-3.5-turbo&quot;, &quot;messages&quot;: [ {&quot;role&quot;: &quot;system&quot;, &quot;content&quot;: &quot;Summarize the following text as if you are Richard Feynman&quot;}, {&quot;role&quot;: &quot;user&quot;, &quot;content&quot;: selection} ] }); xhr.send(data);})(&quot;YOUR API KEY HERE&quot;)

</code></pre>
You need a key from https:&#x2F;&#x2F;platform.openai.com&#x2F;account&#x2F;api-keys<p>Just select a bunch of text and click the bookmarklet, it will replace the page with the chatgpt answer of &quot;Summarize the following text as if you are Richard Feynman&quot;
